import React, { Component } from 'react';
import DeliveryTime from '../../atoms/header/DeliveryTime';
import LocationInput from '../../atoms/header/LocationInput';
import './location.scss';

class Location extends Component {
    constructor(props) {
        super(props)
        this.state = {
            location: "ban"
        }
        // this.input = React.createRef();
    }

    changeInput = () => {
        this.setState(() => {
            console.log(this.input.current.inputRef)
            this.state.location = this.input.current.value;
            // console.log(this.state.location);
        });
    };

    render() {
        return (
            <div className='location'>
                <DeliveryTime location={this.state}/>
                <LocationInput changeInput={this.changeInput} />
            </div>
        )
    }
}

export default Location
